import React from 'react';
import './MainStyle.css' ;
import {Table } from './Components/Table'

class App extends React.Component {
  render() {
    return (
    <div>
      <table>
          <thead>
            <tr>
              <th>Id</th>
              <th>Name</th>
              <th>Age</th>
              <th>E-mail</th>
              <th>Address</th> 
            </tr> 
          </thead>
      </table>
    </div>);
  }
}

export default App;
